import React from 'react'
import { Link } from 'react-router-dom'
import { connect } from 'react-redux'

class ScoreItem extends React.Component{
    render(){
        const id = this.props.match.params.id
        const {doneTasks} = this.props
        const arr = doneTasks.filter(elem => "" === id)
        const elem = arr[0]

        return(
            <tr>
                <td>{elem.id}</td>
                <td><Link to={`/id${elem.id}`}>{elem.name}</Link></td>
                <td>{elem.startTime.hours}:{elem.startTime.minutes}</td>
                <td>{elem.stopTime.hours}:{elem.stopTime.minutes}</td>
                <td>{elem.duration}s</td>
            </tr>
        )
    }
}

const mapStateToProps = state => {
    return {
        doneTasks: state.doneTasks
    }
}

export default connect(mapStateToProps)(ScoreItem)




